import { Route, Routes } from "react-router-dom";

const Welcome = () => {
  return (
    <section>
      <h1> The Welcome Page</h1>
      <div>
        <Route path="/welcome/newsletter-user">
          <p> Welcome user from our News Letter! </p>
        </Route>
      </div>
    </section>
  );
};

export default Welcome;
